import React from "react";
import css from "@emotion/css";
import { COLORS } from "../../../constants";

const LeftInfo = ({ isProfileData }) => {
  const pData = isProfileData && isProfileData.profile;
  console.log(pData);

  return (
    <React.Fragment>
      <div className="block">
        <div
          className="text-sm font-sans"
          css={css`
            & > p {
              border-bottom: 1px solid ${COLORS.GRAY_LIGHTER};
              display: block;
            }
            & > p > span {
              float: left;
              width: 48%;
            }
          `}
        >
          {pData &&
            pData.length > 0 &&
            pData.map((item) => (
              <p key={item} className="clearfix">
                <span>Name </span>
                <span>{item.firstName}</span>
              </p>
            ))}
        </div>
      </div>
    </React.Fragment>
  );
};

export default LeftInfo;
